import React from "react";
import { Link } from "react-router-dom";
import logo from '../asset/img/logo192.png';

function Login(){
    return(
        <div className="container">
            <div className="row">
                <div className="col">

                </div>
                <div className="col">
                    <div className="text-end">
                        <img src={logo}></img>
                    </div>
                    <div className="fw-bold text-center pt-5 mb-5">Bienvenido</div>
                </div>
            </div>
        </div>
    );
}

export default Login;
